import React from 'react';
import {NavLink} from 'react-router-dom';
import './Nav.css';
import 'bootstrap/dist/css/bootstrap.css';

function Nav() {
    return (
      <>

        <div className='main bg-dark py-1 px-3 d-flex align-items-center justify-content-start'>
            <div className='logo px-3'>
                <img src="images/logomovie.png" alt="" />
            </div>
            <div className='menu px-3 d-flex justify-content-around'>
                <div className=' px-3 py-2 mx-3 border-0 border-light rounded'><NavLink exact activeClassName="active_class" to="/home.js" > Home</NavLink> </div>
                <div className=' px-3 py-2 mx-3 border-0 border-light rounded'><NavLink exact activeClassName="active_class" to="/about.js" > About</NavLink> </div>
                <div className=' px-3 py-2 mx-3 border-0 border-light rounded'><NavLink exact activeClassName="active_class" to="/contact.js" >Contact</NavLink> </div>
                <div className=' px-3 py-2 mx-3 border-0 border-light rounded'><NavLink exact activeClassName="active_class" to="/services.js" >Services</NavLink> </div>
            
            </div>
        </div>
      </>
    );
}

export default Nav;
